import React from 'react';
import { Routes, Route } from 'react-router-dom';
import './App.css';
import FlexImg from "./assets/flex-img.jpg"
import AuthLayout from './layout/Auth/AuthLayout';
import ForgotPassword from './pages/forgot_password/ForgotPassword';
import ResetPassword from './pages/reset_password/ResetPassword';

import { AuthenticationBody } from './components';
import {UpdatePasswordPage} from './pages'


function App() {
  return (
    <div className="App">
      <Routes>
        <Route path="/forgot-password" 
        element={<AuthLayout 
          leftContent={<ForgotPassword />}
          rightContent={<img className='flex--img' src={FlexImg} alt="guy typing" />}
        />} />
        <Route path="/login" element={<AuthenticationBody />} />
        <Route path="/updatepassword" element={<UpdatePasswordPage />} />

<Route path="/reset-password" 
        element={<AuthLayout 
          leftContent={<ResetPassword />}
          rightContent={<img className='flex--img' src={FlexImg} alt="guy typing" />}
        />} />
      </Routes>      
    </div>
  );
}

export default App;
